import React from 'react';
import { MDBFooter, MDBBtn } from 'mdbreact';

const Footer = () => {
    return (
        <MDBFooter id="footer">
            <div className="row">
                <div className="col-md-6">
                    <center><MDBBtn>RAKOTONIRINA Mamisoa Jean luc</MDBBtn></center>
                </div>
            </div>
        </MDBFooter>
    );
}

export default Footer;
